contracts/project.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract Dapp{
    
    struct worker{
        string name;
        uint age;
        uint id;
    }
    
    //create instance
 worker _worker;
    
    function setworkerValues(string memory _name, uint _age, uint _id) public{
         _worker.name=_name;
         _worker.age=_age;
         _worker.id=_id;
    }
    
    function getworkerValues() public view returns(string memory, uint, uint){
        return ( _worker.name,  _worker.age,  _worker.id);
        
    }
    
}

